import React from "react";

const renderObject = (obj) => {
  if (typeof obj === "string") {
    // If the object is a string, render it as a text node.
    return obj;
  }

  const { type, props, children } = obj;

  if (Array.isArray(children)) {
    // If children is an array, map through the children and render them.
    return React.createElement(type, props, children.map(renderObject));
  }

  return React.createElement(type, props, renderObject(children));
};

const Layout3Object = {
  type: "Box",
  props: {
    bg: "gray.4",
    h: 200,
    style: { borderRadius: "10px" },
  },
  children: [
    {
      type: "Stack",
      children: [
        {
          type: "Box",
          props: {
            bg: "lime.5",
            style: { borderRadius: "10px 10px 0 0", cursor: "pointer" },
          },
          children: {
            type: "Center",
            children: {
              type: "Text",
              children: "Test",
            },
          },
        },
        {
          type: "Grid",
          props: { ml: "xs", mr: "xs" },
          children: items.map((item) => ({
            type: "Grid.Col",
            props: { span: 4 },
            children: {
              type: "Box",
              props: {
                bg: "blue.1",
                h: 60,
                style: { border: "1px solid #000000", cursor: "pointer" },
              },
              children: {
                type: "Center",
                children: item,
              },
            },
          })),
        },
      ],
    },
  ],
};

const Layout3 = () => {
  return renderObject(Layout3Object);
};

export default Layout3;
